// AuthServiceServer is the server API for AuthService service.
type AuthServiceServer interface {
	// Registers a new device.
	CreateDeviceRegistration(context.Context, *CreateDeviceRegistrationRequest) (*DeviceRegistration, error)
	// Creates a new user.
	CreateUser(context.Context, *CreateUserRequest) (*CreateUserResponse, error)
	// Creates a new access token that can be used to access the authenticated APIs.
	CreateAccessToken(context.Context, *CreateAccessTokenRequest) (*AccessToken, error)
	// Creates machine-to-machine token. This method will be replaced by service account API in the future.
	CreateMachineToken(context.Context, *CreateMachineTokenRequest) (*CreateMachineTokenResponse, error)
	// Gets the profile of the current user.
	GetCurrentUser(context.Context, *empty.Empty) (*User, error)
	// Updates the profile of the current user.
	UpdateCurrentUser(context.Context, *UpdateCurrentUserRequest) (*User, error)
	// Create a new authentication flow by requesting password parameters.
	StartPasswordAuthn(context.Context, *StartPasswordAuthnRequest) (*AuthenticationState, error)
	// Authenticate by starting SPAKE2+ key exchange.
	PasswordAuthnKeyExchange(context.Context, *PasswordAuthnKeyExchangeRequest) (*AuthenticationState, error)
	// Authenticates a user by a first factor.
	FinishPasswordAuthn(context.Context, *FinishPasswordAuthnRequest) (*AuthenticationState, error)
	// Requests a challenge for the second-factor authentication.
	StartAuthenticateSecondFactor(context.Context, *StartAuthenticateSecondFactorRequest) (*StartAuthenticateSecondFactorResponse, error)
	// Authenticates a user by a second factor.
	AuthenticateSecondFactor(context.Context, *AuthenticateSecondFactorRequest) (*AuthenticationState, error)
	// Creates a new authentication flow by requesting an email (or SMS) for reset password.
	StartResetPasswordAuthentication(context.Context, *StartResetPasswordAuthenticationRequest) (*ResetPasswordAuthenticationState, error)
	// Authenticates a user by a first factor for reset password.
	AuthenticateResetPassword(context.Context, *AuthenticateResetPasswordRequest) (*ResetPasswordAuthenticationState, error)
	// Authenticates a user by a second factor for reset password.
	AuthenticateResetPasswordSecondFactor(context.Context, *AuthenticateResetPasswordSecondFactorRequest) (*ResetPasswordAuthenticationState, error)
	// Creates a new authentication flow by requesting a new OAuth state.
	StartAuthenticateOAuth(context.Context, *StartAuthenticateOAuthRequest) (*StartAuthenticateOAuthResponse, error)
	// Authenticates a user by an OAuth factor.
	AuthenticateOAuth(context.Context, *AuthenticateOAuthRequest) (*AuthenticateOAuthResponse, error)
	// Initiates the process to create external OAuth authentication as the first factor.
	StartCreateOAuthFactor(context.Context, *StartCreateOAuthFactorRequest) (*StartCreateOAuthFactorResponse, error)
	// Creates an OAuth factor of the current user by the response from OAuth.
	CreateOAuthFactor(context.Context, *CreateOAuthFactorRequest) (*CreateOAuthFactorResponse, error)
	// Creates an OAuth factor of the current user by an encrypted access token.
	CreateOAuthFactorByAccessToken(context.Context, *CreateOAuthFactorByAccessTokenRequest) (*CreateOAuthFactorByAccessTokenResponse, error)
	// Lists the owned OAuth factors.
	ListOAuthFactors(context.Context, *ListOAuthFactorsRequest) (*ListOAuthFactorsResponse, error)
	// Deletes an owned OAuth factor.
	DeleteOAuthFactor(context.Context, *DeleteOAuthFactorRequest) (*DeleteOAuthFactorResponse, error)
	// Initiates the process of creating second factor.
	StartCreateSecondFactor(context.Context, *StartCreateSecondFactorRequest) (*StartCreateSecondFactorResponse, error)
	// Creates a second factor of the current user.
	CreateSecondFactor(context.Context, *CreateSecondFactorRequest) (*SecondFactor, error)
	// Lists the owned second factors.
	ListSecondFactors(context.Context, *ListSecondFactorsRequest) (*ListSecondFactorsResponse, error)
	// Deletes an owned second factor.
	DeleteSecondFactor(context.Context, *DeleteSecondFactorRequest) (*DeleteSecondFactorResponse, error)
	// Creates a new contact for the current user.
	CreateContact(context.Context, *CreateContactRequest) (*Contact, error)
	// Updates the primary contact for the current user.
	UpdatePrimaryContact(context.Context, *UpdatePrimaryContactRequest) (*Contact, error)
	// Lists the owned contacts.
	ListContacts(context.Context, *ListContactsRequest) (*ListContactsResponse, error)
	// Deletes an owned contact.
	DeleteContact(context.Context, *DeleteContactRequest) (*DeleteContactResponse, error)
	// Starts the contact verification flow.
	StartVerifyContact(context.Context, *StartVerifyContactRequest) (*StartVerifyContactResponse, error)
	// Completes a contact verification with verification code for the current user.
	CompleteVerifyContact(context.Context, *CompleteVerifyContactRequest) (*CompleteVerifyContactResponse, error)
	// Starts the contact verification flow.
	StartVerifyPrimaryContact(context.Context, *StartVerifyPrimaryContactRequest) (*StartVerifyPrimaryContactResponse, error)
	// Completes a contact verification with verification code for the current user.
	CompleteVerifyPrimaryContact(context.Context, *CompleteVerifyPrimaryContactRequest) (*CompleteVerifyPrimaryContactResponse, error)
	// Create a change password flow for current user by requesting password parameters.
	StartChangePassword(context.Context, *StartChangePasswordRequest) (*StartChangePasswordResponse, error)
	// Continue the change password flow by complete key exchange and creates a challenge for SPAKE2+ for the current user.
	ChangePasswordKeyExchange(context.Context, *ChangePasswordKeyExchangeRequest) (*PasswordChallenge, error)
	// Changes the password for the current user.
	FinishChangePassword(context.Context, *FinishChangePasswordRequest) (*FinishChangePasswordResponse, error)
	// Resets the password.
	ResetPassword(context.Context, *ResetPasswordRequest) (*ResetPasswordResponse, error)
	// Lists the active sessions of the current user.
	ListSessions(context.Context, *ListSessionsRequest) (*ListSessionsResponse, error)
	// Deletes an active session of the current user.
	DeleteSession(context.Context, *DeleteSessionRequest) (*DeleteSessionResponse, error)
	// Deletes the current session of the current user.
	DeleteCurrentSession(context.Context, *DeleteCurrentSessionRequest) (*DeleteCurrentSessionResponse, error)
	CreateAuthorizationToken(context.Context, *CreateAuthorizationTokenRequest) (*AuthorizationToken, error)
	// Checks if a given handle (username, email or phone number) is available for use.
	CheckHandleAvailability(context.Context, *CheckHandleAvailabilityRequest) (*CheckHandleAvailabilityResponse, error)
	// Creates a proof of work challenge.
	CreateProofOfWorkChallenge(context.Context, *empty.Empty) (*ProofOfWorkChallenge, error)
	// Gets the user metadata of the current user.
	GetMetadata(context.Context, *GetMetadataRequest) (*GetMetadataResponse, error)
	// Updates the user metadata of the current user.
	UpdateMetadata(context.Context, *UpdateMetadataRequest) (*UpdateMetadataResponse, error)
	// Validates the parameters used for OAuth authentication.
	ValidateOAuthParameters(context.Context, *ValidateOAuthParametersRequest) (*ValidateOAuthParametersResponse, error)
	// Get settings and parameters for widgets.
	GetWidgetsSettings(context.Context, *GetWidgetsSettingsRequest) (*GetWidgetsSettingsResponse, error)
}

